(20, '2019012814283520', '4700711-27828', 'Cc60 Adaro Indonesia', 'C.Tel. 17/YN 000/DES', '-', 'SEGMEN MAS & Pak Leman', '2019-01-28', '<table class="NormalTable"><tbody><tr><td width="534"><span class="fontstyle0">Permintaan Penggantian UPS untuk Switch VPN IP ADARO INDONESIA SiD 4700711-27828<br>alamat Menara Karya Lt.23 JL HR Rasuna Said Blok X-5 KAV 1-2 Jakarta</span></td></tr></tbody></table><p> \r\n</p><p><span class="fontstyle0">1. </span><span class="fontstyle0" style="font-size:11pt;">Menunjuk dan mempertimbangkan :<br></span><span class="fontstyle0">&nbsp; &nbsp; a. </span><span class="fontstyle0" style="font-size:11pt;">Gangguan VPNIP CC60 ADARO INDONESIA SID 4700711-27828 Bw 40 Mbps, JL<br>HR RASUNA SAID BLOK X-5 KAV. 1-2 MENARA KARYA LT. 23<br>JAKARTA#99999 dengan History nomor tiket IN46489787.<br></span><span class="fontstyle0">&nbsp; &nbsp; b. </span><span class="fontstyle0" style="font-size:11pt;">Ganggan disebabkan Switch yang mencatu layanan tersebut yang berada di lt 12<br>down dan sudah di lakukan penggantian Switch<br></span><span class="fontstyle0">&nbsp; &nbsp; c. </span><span class="fontstyle0" style="font-size:11pt;">Switch rusak di sebabkan catuan PLN yang up down dan UPS tidak bisa mencatu<br>karena rusak.<br><br></span><span class="fontstyle0">2. </span><span class="fontstyle0" style="font-size:11pt;">Sehubungan dengan hal tersebut mohon bantuan Saudara untuk dapat melakukan<br>penggantian UPS di lokasi menara karya yang nantinya di gunakan sebagai catuan<br>backup perangkat Switch tersebut.<br><br></span><span class="fontstyle0">3. </span><span class="fontstyle0" style="font-size:11pt;">Selanjutnya untuk koordinasi lebih lanjut,dapat berkoordinasi dengan Sdr. Herman<br>Hidayat di 082111154348 , Dan AM Adaro Indonesia Sdr Muhammad Dika Prayudha<br>082358250099 atau EOS Telkom untuk Adaro Indonesia Sdri Roslena Elisabeth<br>Sitanggang di 085275267722.</span>&nbsp;&nbsp;<br style="font-variant-numeric: normal; font-variant-east-asian: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;"></p>', '-', 'MAS', '2', 'Jakarta Selatan', 'Menara Karya Lt.23 Jl Hr Rasuna Said Blok X-5 Kav 1-2 Jakarta', 'On Progress', '2019-01-28', 'Vpnip', 'doc_file/Permintaan Penggantian UPS untuk Switch VPN IP ADARO INDONESIA SiD 4700711-27828 alamat Men', 'application/pdf', '112840', ''),
(17, '2019011810241917', '4700523-0023182812', 'Pt Samator Gas Industri', 'C.Tel. 433/UM 000/R5', '1-3019698892', 'SEGEMEN MAS', '2019-01-03', '<p><span style="font-size: 12px;">Nomor : C.Tel. 433/UM 000/R5W-5M100000/2018</span></p><p><span style="font-size: 12px;">Kepada : 1. Sdr. GM WITEL MEDAN</span></p><p><span style="font-size: 12px;">2. Sdr. GM ES MANUFACTURING AND AGRIBUSINESS SERVICES DES</span></p><p><span style="font-size: 12px;">Dari : GM WITEL SURABAYA SELATAN</span></p><p><span style="font-size: 12px;">Lampiran : 3 (tiga) berkas</span></p><p><span style="font-size: 12px;">Perihal : Permohonan solusi gangguan layanan VPN IP PT Samator Gas Indonesia Stabat</span></p><p><span style="font-size: 12px;">1. Menunjuk email pelanggan PT Samator Gas Industri terkait dengan permasalahan layanan VPN IP lokasi</span></p><p><span style="font-size: 12px;">Stabat Medan (terlampir).</span></p><p><span style="font-size: 12px;">2. Berikut detail untuk layanan existing VPN IP Samator Stabat :</span></p><p><span style="font-size: 12px;">SID 4700523-0023182812, VPN IP 512kbps.</span></p><p><span style="font-size: 12px;">Lokasi PT SGI Stabat, Ds Batu Malenggang, Pasar 2 Kec.Hinai Langkat.</span></p><p><span style="font-size: 12px;">Koordinat lokasi 3.849858, 98.427981.</span></p><p><span style="font-size: 12px;">3. Berdasarkan hasil koordinasi dengan CCAN Witel Medan, saat ini kondisi jaringan tembaga pelanggan</span></p><p><span style="font-size: 12px;">rawan gangguan karena kondisi jaringan yang sudah kritis, dimana dalam 2 bulan terakhir sudah terjadi</span></p><p><span style="font-size: 12px;">laporan gangguan sebanyak 6 (enam) kali (historis terlampir).</span></p><p><span style="font-size: 12px;">4. Sehubungan operasional pelanggan yang seringkali terganggu akibat gangguan layanan tersebut, dan SLG</span></p><p><span style="font-size: 12px;">antara Telkom dengan PT Samator Gas Industri untuk layanan VPN IP adalah 99%, dimana SLG tersebut</span></p><p><span style="font-size: 12px;">tidak dapat dijaminkan dengan kondisi jaringan existing, dimohon bantuan Saudara untuk solusi perbaikan</span></p><p><span style="font-size: 12px;">layanan yang dapat ditindaklanjuti dengan 2 (dua) opsi antara lain:</span></p><p><span style="font-size: 12px;">Modernisasi jaringan dengan melakukan penarikan FO ke lokasi pelanggan.</span></p><p><span style="font-size: 12px;">Trial Astinet lite 10Mbps via Radio sesuai dengan permintaan pelanggan dalam email terlampir.</span></p><p><span style="font-size: 12px;">5. Kami sampaikan bahwa saat ini Telkom tengah dalam proses negosiasi dengan Samator Group untuk</span></p><p><span style="font-size: 12px;">perpanjangan kontrak 2019 layanan VPN IP, Astinet Lite, dan Indihome untuk lokasi existing dan</span></p><p><span style="font-size: 12px;">penambahan lokasi baru dengan total jumlah lokasi sebanyak 97 titik di seluruh wilayah Indonesia. Untuk</span></p><p><span style="font-size: 12px;">lokasi kantor Stabat, kebutuhan layanan yang diajukan Samator Group adalah Astinet Lite 10 Mbps.</span></p><p><span style="font-size: 12px;">6. Untuk koordinasi lebih lanjut dapat menghubungi PIC pelanggan dengan Sdr. Aristianto, nomor telp 0813-</span></p><p><span style="font-size: 12px;">1133-6605, email aris@anekagas.com atau AM Telkom Sdr. Ayrton Ika Rinjani, nomor telepon 0811-342-</span></p><p><span style="font-size: 12px;">122, email ayrton@telkom.co.id.</span></p><p><span style="font-size: 12px;">7. Demikian disampaikan, atas bantuan dan kerjasamanya kami mengucapkan terimakasih.</span></p><p><span style="font-size: 12px;">Salam Solid Speed Smart..!</span></p><p><span style="font-size: 12px;">Surabaya, 31 Desember 2018</span></p><p><span style="font-size: 12px;">Djoko Srie Handono</span></p><p><span style="font-size: 12px;">NIK: 710372</span></p>', 'IN38418911', 'MAS', '1', 'Sumut Barat', 'Ds Batu Malenggang, Pasar 2 Kec.hinai Langkat, Sumut Barat (medan)', 'Close', '2019-01-18', 'Vpnip', 'doc_file/Permohonan Quality Enhancement untuk Gangguan Berulang Layanan VPN-IP PT. Samator Gas Indon', 'application/pdf', '95600', ''),
