(27, '2019021109360627', '4700239- 0021649215', 'Pt Japfa Indonesia', 'C.Tel. 1/YN 000/DES-', '-', 'SEGMEN MAS', '2019-02-06', '<p><span class="fontstyle0"><span class="fontstyle0">Permohonan Percepatan Pengadaan Penggantian Modem ONT F660 dengan Modem ONT<br>821 (Type F821), dan Perkabelannya untuk Solusi Penanganan Gangguan PT Japfa Indonesia<br>Tiket IN46573963</span>&nbsp;&nbsp;<br style="font-variant-numeric: normal; font-variant-east-asian: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;"></span></p><p><span class="fontstyle0"><br></span></p><p><span class="fontstyle0">1. Menunjuk dan menimbang :<br>a. Email AM PT JAPFA INDONESIA Sdr. M.Tohir / 700098 perihal : </span><span class="fontstyle2">â€œPermintaan Pergantian modem ONT F660 menjadi ONT F821untuk Penanganan<br>Gangguan vpn 70 mbps dan metro 300 mbps PT Japfa Indonesia<br></span><span class="fontstyle0">b. </span><span class="fontstyle2">Tiket Gangguan IN46573963<br></span><span class="fontstyle0">c. Saat ini sedang dilakukan penyelesaian penanganan penanganan gangguan, namun memerlukan Modem ONT F821 .<br>2. Sehubungan dengan hal tersebut diatas dan untuk percepatan penyelesaian gangguan, mohon dukungannya untuk percepatan pengadaan permintaan </span><span class="fontstyle2">1 unit<br>modem ONT 821 type F821, dan perkabelannya </span><span class="fontstyle0">pada kesempatan pertama.<br>3. Adapun data-data nomor yang mengalami gangguan sejak 12 Februari 2018 dengan tiket </span><span class="fontstyle2">IN 46573963 </span><span class="fontstyle0">adalah sbb :<br></span></p><table class="NormalTable"><tbody><tr><td width="17"><span class="fontstyle0">NO </span></td><td width="55"><span class="fontstyle0">NAMA CC </span></td><td width="82"><span class="fontstyle0">ALAMAT </span></td><td width="35"><span class="fontstyle0">WITEL </span></td><td width="30"><span class="fontstyle0">UNER </span></td><td width="57"><span class="fontstyle0">LAYANAN </span></td><td width="94"><span class="fontstyle0">SID </span></td><td width="47"><span class="fontstyle0">PIC CC </span></td><td width="60"><span class="fontstyle0">AM </span></td><td width="160"><span class="fontstyle0">KETERANGAN</span></td></tr><tr><td width="17"><span class="fontstyle0">1 </span></td><td width="55"><span class="fontstyle0">PT JAPFA<br>INDONESIA</span></td><td width="82"><span class="fontstyle0">Wisma Milenia Jl<br>MT Haryono kav<br>16 Jakarta Timur</span></td><td width="35"><span class="fontstyle0">Jakarta<br>Timur </span></td><td width="30"><span class="fontstyle0">2</span></td><td width="57"><span class="fontstyle0">VPN IP 70<br>mbps dan<br>Metro 300<br>mbps</span></td><td width="94"><span class="fontstyle0">4700239-<br>0021649215 VPNIP<br>dan 4700239-<br>0021412993 Metro</span></td><td width="47"><span class="fontstyle0">Pak<br>Freddy<br>+62 812-<br>8805-<br>8426</span></td><td width="60"><span class="fontstyle0">M. Tohir /<br>08121288446</span></td><td width="160"><span class="fontstyle0">Permintaan Percepatam Pengadaan<br>penggantian modem ONT F660<br>dengan F821 untuk solusi gangguan<br>tiket : IN46573963</span></td></tr></tbody></table><p><span class="fontstyle0">4. Untuk koordinasi lebih lanjut dapat menghubung AM terkait Sdr M. Tohir / 08121288446.<br>5. Demikian disampaikan, atas kerjasamanya diucapkan terimakasih</span>&nbsp;&nbsp;<br style="font-variant-numeric: normal; font-variant-east-asian: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;"></p>', 'IN46573963', 'MAS', '2', 'Jakarta Timur', 'Wisma Millenia Jl Mt Haryono Kav 16', 'On Progress', '2019-02-11', 'Vpnip & Metro E', 'doc_file/Permohonan Percepatan Pengadaan Penggantian Modem ONT F660 dengan Modem ONT 821 (Type F821)', 'application/pdf', '97150', '');
