(32, '2019011714484306-32', '2019011714484306', '<p>Info dari EOS Andira +62813-1456-0804</p><p>- Untuk penarikan sw hari senin 05 nov 2018 sudah dipasang ke lokasi sesuai info sebelumnya, tetapi terdapat kendala sw belum terpasang ip management sehingga sw dibawa kembali ke sto untuk diconfig kembali</p><p>- Sesuai info dari pic pemasangan sw bisa dilakukan kembali hari sabtu 10 nov 2018</p>', '2019-01-17', '14:56:14', ''),
(33, '2019011714484306-33', '2019011714484306', '<p>Update Selasa 06 Nov 2018</p><p><br></p><p>Update Pergantian SW Bdcom ke SW Fiber Home NTT u/ Swadarma Prima Utama Cikande</p><p><br></p><p>Info Pak Firman +62812-5960-5546 mitra ccan (PT.AKU)</p><p>- Sebelumnyaa sudah sampai kelokasi customer untuk dilakukan penarikan kabel, tetapi info dari pic pak yoswin minta dipending dahulu untuk penarikannyaa</p><p>- Saat ini tim mitra masih menunggu info lebih lanjutt dari pic untuk proses penraikan jt nya.</p>', '2019-01-17', '14:56:45', ''),
(34, '2019011714484306-34', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; Penarikan JT \r\nCustomer NTT u/ Swasarma Prima Utama Cikande Serang\r\n\r\n- Koordinasi dg EOS NTT Andira, sudah janjian dengan petugas dan customer untuk penarikan JT akan dilakukan pada tanggal 15 s/d 16 Nov 2018\r\n- Untuk pemasangan SW akan dilakukan kembali pada tanggal 17 Nov 2018\r\n\r\nDemikian infonya\r\nTks</pre>', '2019-01-17', '14:57:03', ''),
(35, '2019011714484306-35', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; Penarikan JT \r\n\r\nConfrence dengan Mitra PT AKU Pak Andi 085213920513 &amp; EOS NTT Andira\r\n- Hasil survey oleh tim mitra penarikan JT akan dilewatkan dari ODP --&gt; Server Pelanggan\r\n- Disaat akan ditarik PIC meminta untuk penarikan dilewatkan langsung dari ODC ---&gt; Server pelanggan, dengan alasan hawatir terjadi gangguan kembali\r\n- Jika dilewatkan via ODC dibutuhkan core murni sepanjang 900 M, dikarenakan tidak memenuhi budget yg sudah dihitung maka penarikan ditunda \r\n- Sebelumnyaa disaat survey tim mitra dan pic sudah sepakat penarikan akan dilewatkan via ODP tetapi saat akan ditarik PIC meminta dirubah jalurnyaa\r\n- Saat ini EOS sedang koordinasi dg PIC dan AM terkait info diatas\r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '14:57:26', ''),
(36, '2019011714484306-36', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; Penarikan JT \r\n\r\nConfrence dengan Mitra PT AKU Pak Andi 085213920513, EOS NTT Andira &amp; PIC NTT Pak Kaesar 081289662664 \r\n- Setlah dikonfirmasi oleh Kaesara pic dilokasi tidak pernah merubah permintaan untuk penarikan, sehingga disimpulkan ada mis komunikasi antara mitra dg pic dilokasi\r\n- Untuk penarikan JT akan dilakukan besok pukul 09.30 wib oleh PT AKU dan akan dilewatkan sesuai survey sebelumnya jalur via ODP ke server pelanggan\r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '14:57:51', ''),
(37, '2019011714484306-37', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; JT NTT Swadarma Prima Utama Cikande\r\n\r\n- Info dari EOS Andira untuk penarikan JT sudah selesai sampai ke sisi customer\r\n- Untuk migrasi ke sw belum bisa dilakukan dikarenakan redaman dari hasil penarikan JT masih belum mendapatkan redaman disebabkan kabel distibuti ke arah ODP rusak\r\n- Progres dilanjut hari ini, dan sedang dikonfirmasi ulang oleh EOS \r\n\r\nDemikian Infonyaa\r\nTks</pre>', '2019-01-17', '14:58:10', ''),
(38, '2019011714484306-38', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; JT NTT Swadarma Prima Utama Cikande\r\n\r\n- Konfirmasi pak Jasmanto optima banten, beliau infonyaa belum mendapatkan update dri PT AKU terkait penarikan yg sudah selesai dan belum dapat redaman\r\n- Saat ini pak jasmanto akan koordinasi ulang dg PT AKU serta akan dibuatkan nodin repair dari diatribusi ke arah ODP\r\n- Infonyaa akan diupdate kembali via whatsapp jika sudah selesai diskusi\r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '14:58:32', ''),
(39, '2019011714484306-39', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW &amp; JT NTT Swadarma Prima Utama Cikande\r\nKamis, 22 November 2018 \r\n\r\n- kordinasi dengan tim progress Yasunaga Indonesia pak Juheli\r\nuntuk redaman kabel KU dari ODP terdekat menuju ke ikg customer sudah selesai\r\nsudah mendapatkan redaman terbaik,\r\n- dan sekarang link METRO Yasunaga Indonesia, sudah menggunakan jalur baru Via ODP\r\nterdekat menggunakan Kabel KU\r\n- sudah mendapatkan izin downtime dari pic Pak Yosquin untuk pemindahan jalur\r\n- kondisi sekarang sudah up, dan masih menggunakan sw lama\r\n- Untuk pergantian SW saat ini masih dikoordinasikan dg tim CCAN dan perlu ijin dahulu ke PIC untuk proses down time nya\r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '14:59:11', ''),
(40, '2019011714484306-40', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW NTT Swadarma Prima Utama Cikande\r\n\r\nOn Confrence EOS Swadarma Andira &amp; EOS Area Serang Bambang\r\n- Untuk proses pergantian SW akan dilakukan oleh CCAN Pak Juheli &amp; EOS Area Bambang pada hari Sabtu, 01 Des 2018 pukul 9.00 sampai dengan selesai\r\n- EOS Swadarma pararel update ke PIC terkait proses pergantian SW dilokasi\r\n\r\nDemikian Infonyaa\r\nTks</pre>', '2019-01-17', '14:59:37', ''),
(41, '2019011714484306-41', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Pergantian SW NTT Swadarma Prima Utama Cikande.\r\n\r\nKoordinasi EOS Swadarma Andira &amp; EOS Area Serang Bambang\r\n- Progres pergantian sw Bdcom ke sw HP sudah selesai, saat ini link sudah normal kembali \r\n\r\nSW-D2-CKD-HP-YASUNAGA# show version\r\nImage stamp:    /sw/code/build/walle(t4b_release)\r\n                Jul 27 2009 01:04:24\r\n                J.14.01\r\n                474\r\nBoot Image:     Primary\r\nSW-D2-CKD-HP-YASUNAGA#\r\n\r\nDemikian Infonyaa\r\nTks</pre>', '2019-01-17', '14:59:56', ''),
