(56, '2019011809451412-56', '2019011809451412', '<p><span style="font-size: 11px;">Update Progres Migrasi FO SIKA Celengsi Bogor (VOICE)</span></p><p><br></p><p><span style="font-size: 11px;">- Konfirmasi Asman CCAN Pak Wahyu +62 81380022811 sudah dikonfirmasi ke pak mustaqim sebelumnyaa dari mitra tidak bisa ambil barang ke deployer, tetapi setelah dikonfirmasi ke deployer tidak ada masalah barang bisa direquest ke deployer</span></p><p><span style="font-size: 11px;">- Info kemarin sore barang masih diorder ke deployer, untuk hari ini pak wahyu akan konfirmasi kembali ke deployer dan pak mustaqim untuk progresnya</span></p><p><span style="font-size: 11px;">- Setelah barang ready akan dipasang oleh mitra pak mustaqim dan tim&nbsp;</span></p><p><br></p><p><span style="font-size: 11px;">Demikian infonyaa</span></p><p><span style="font-size: 11px;">Tks</span></p>', '2019-01-18', '09:50:37', ''),
