(63, '2019011809451412-63', '2019011809451412', '<p><span style="font-size: 11px;">Update Progres Migrasi FO SIKA Celengsi Bogor (VOICE)</span></p><p><br></p><p><span style="font-size: 11px;">- Konfirmasi Mitra CCAN Wahyu +62 82116559595 infokan dilokasi sudah dilakukan pemasangan OTB dan penyambungan</span></p><p><span style="font-size: 11px;">- Konfirmasi Asman CCAN Pak Wahyu +62 81380022811 saat ini tim nya masih progres gangguan&nbsp; personal dan gamas dilokas bogor, setelah selesai akan diinfokan kembali untuk proses migrasinya</span></p><p><span style="font-size: 11px;">- Pak Wahyu minta dipastikan dilokasi disaat nanti dimigrasi output ONT kearah pelanggan sudah siap apa tidak, dikarenakan ONT tersebut membawa 24 nomor sehingga perlu dipastikan dilokasi sudah ready ke arah PBX pelanggannya, atau langsung dimigrasi ke SIPTRUNK</span></p><p><br></p><p><span style="font-size: 11px;">-&nbsp; Konfirmasi PIC Pak Iskandar 081511137379 / Pak Erwin 08129268161, dua no tersebut belum bisa dihubungi untuk memastikan kondisi dilokasi sesuai request CCAN.</span></p><p><br></p><p><span style="font-size: 11px;">Demikian infonyaa</span></p><p><span style="font-size: 11px;">Tks</span></p>', '2019-01-18', '09:53:35', ''),
(64, '2019011809451412-64', '2019011809451412', '<p><span style="font-size: 11px;">Update Info :</span><br><br><span style="font-size: 11px;">- Koordinasi dengan petugas Alpin proses pemindahan ont dari pos security ke server belum bisa dilakukan, dikenakan masih terkendala banyak tiket gangguan yang harus diselesaikan</span><br><br><span style="font-size: 11px;">- Setelah tiket gangguan selesai tim ccan akan menginfokan untuk proses perpindahanannya</span></p><p><br></p><p><span style="font-size: 11px;">Demikian infonyaa</span></p><p><span style="font-size: 11px;">Tks</span></p>', '2019-01-18', '09:55:53', ''),
(65, '2019011809584513-65', '2019011809584513', '<p><span style="font-size: 11px;">- ONT telah diambil dari prumpung jatinegara</span></p><p><span style="font-size: 11px;">- Infokan hari ini (26 Oktober 2018) akan kelokasi untuk survey dan pemasangan di lokasi customer</span></p><p><span style="font-size: 11px;">- Di koordinasikan ke AM untuk perizinan dan PIC Customer dilokasi</span></p><p><span style="font-size: 11px;">- Survey telah dilakukan 26 Oktober 2018, karena akan terjadi downtime, maka tidak dilakukan kemarin.</span></p><p><span style="font-size: 11px;">- Koordinasi dengan AM, telah disampaikan usulan rundown dan waktu akan dilaksanakannya migrasi, saat ini masih menunggu izin downtime dari customer</span></p>', '2019-01-18', '10:00:15', ''),
(66, '2019011809584513-66', '2019011809584513', '<p><span style="font-size: 11px;">Update Migrasi ONT untuk Avrist Asuransi :</span></p><p><br></p><p><span style="font-size: 11px;">- Koordinasi ke AM Ibu Elok, saat ini dari sisi customer masih mengalami kendala di internal untuk memasang kabel dari ONT ke perangkat PABX, estimasi akhir desember baru ready disisi customer.</span></p><p><span style="font-size: 11px;">- Menimbang masa freeze network telkom siaga NARU 2018/2019 ditanggal 12 Desember 2018 - 2 Januari 2019, maka switching/migrasi diestimasikan baru bisa dilaksanakan di awal Januari 2019,</span></p><p><br></p><p><span style="font-size: 11px;">Demikian disampaikan, terimakasih</span></p>', '2019-01-18', '10:00:52', ''),
(67, '2019011810061214-67', '2019011810061214', '<p><span style="font-size: 11px;">Troubleshoot 1 (10/10/2018 11.15 WIB)</span></p><p><span style="font-size: 11px;">Simulasi di ruang server dengan 1 ONT dan 1 Register,</span></p><p><span style="font-size: 11px;">- Call dari ext unit ke ext unit hasil OK</span></p><p><span style="font-size: 11px;">- Call dari ext unit ke ext operator hasil OK</span></p><p><br></p><p><span style="font-size: 11px;">*Troubleshoot 2 (10/10/2018 14.30 WIB)*</span></p><p><span style="font-size: 11px;">Simulasi di ruang server dengan 3 ONT dan 3 sip phone (2 sip phone unit &amp; 1 sip phone operator)</span></p><p><span style="font-size: 11px;">- Call dari operator ke ext unit hasil OK</span></p><p><span style="font-size: 11px;">- Call dari ext unit ke ext unit hasil OK</span></p><p><br></p><p><span style="font-size: 11px;">*Troubleshoot 3 (10/10/2018 14.50 WIB)*</span></p><p><span style="font-size: 11px;">Simulasi di ruang server dengan 3 sip phone tanpa OLT (PABX - L3 - sip phone)</span></p><p><span style="font-size: 11px;">- Call dari operator ke unit hasil OK</span></p><p><span style="font-size: 11px;">- Call dari unit ke operator hasil OK</span></p><p><span style="font-size: 11px;">- Call dari unit ke unit hasil OK</span></p><p><br></p><p><span style="font-size: 11px;">*Troubleshoot 4 (10/10/2018 17.30 WIB)*</span></p><p><span style="font-size: 11px;">Simulasi di ruang server dengan mengganti codec di sip phone PCMA &gt; PCMU</span></p><p><span style="font-size: 11px;">- test di server hasil OK</span></p><p><span style="font-size: 11px;">- test langsung di unit hasil OK</span></p><p><br></p><p><span style="font-size: 11px;">*Troubleshoot 5 (10/10/2018 22.30 WIB)*</span></p><p><span style="font-size: 11px;">Penambahan fitur MMF di OLT</span></p><p><span style="font-size: 11px;">- hasil test call di unit (atas), call antar ext unit ke ext unit hasil oke</span></p><p><span style="font-size: 11px;">- call antar ext unit ke operator hasil OK