(75, '2019011810192116-75', '2019011810192116', '<p><span style="font-size: 11px;">Update Info :</span></p><p><br></p><p><span style="font-size: 11px;">*MM_IPVPN SURYA MADISTRINDO ( GUDANG GARAM GROUP)&nbsp; SID 4707197-0031049802 Jl. Desa Peltong Raya Sumenep km 47,0,Pamekasan Jatim*</span></p><p><br></p><p><span style="font-size: 11px;">*MM_VPNIP GUDANG GARAM SID 4701883-0021424188 Desa Peltong, Kec. Larangan Pamekasan*</span></p><p><br></p><p><span style="font-size: 11px;">*1. Koordinasi dengan EOS Ahmad Fariddudin +62 85718100387*&nbsp;</span></p><p><br></p><p><span style="font-size: 11px;">- Kronologis dilokasi sudah beberapa kali terjadi gangguan pada bulan oktober 2018 ini disebebkan imbas gamas. Berikut history tiketnya :</span></p><p><span style="font-size: 11px;">*Tanggal 3 Desember 2018*</span></p><p><span style="font-size: 11px;">SM AO Pamekasan : IN43984869</span></p><p><span style="font-size: 11px;">GG WH pamekasan : IN43987690</span></p><p><span style="font-size: 11px;">*Tanggal 4 Desember 2018*</span></p><p><span style="font-size: 11px;">SM AO Pamekasan : IN44055203</span></p><p><span style="font-size: 11px;">GG WH Pamekasan : IN44056065</span></p><p><br></p><p><span style="font-size: 11px;">- Permintaan dari IT pelanggan minta dilakukan pengecekan dilokasi apakah tersedia jalur lain yang bisa dijadikan jalur sementara jika sedang terjadi gangguan atau sedang ada gamas.</span></p><p><br></p><p><span style="font-size: 11px;">*2. Konrdinasi dengan Petugas CCAN Pamekasan Pak Assis +62 85257290123*</span></p><p><br></p><p><span style="font-size: 11px;">- Dilokasi hanya terdapat satu gpon (GPON00-D5-PME-3) dan semua pelanggan yang ada disana dicatu dalam satu gpon tersebut dan tidak memungkinkan adanyaa jalur sementara disaat sedang ada gangguan</span></p><p><span style="font-size: 11px;">- Sudah beberapa kali terjadi gamas disebabkan vandalisme, terpotong dikarenakan ada mitra lain sedang perbaikan, dan beberapa case lainnya</span></p><p><span style="font-size: 11px;">-&nbsp; Untuk pelanggan ini topologinya dari GPON ---&gt; ODC ---&gt; ODC B ---&gt; ODP ---&gt; Pelanggan</span></p><p><span style="font-size: 11px;">Jarak GPON ke ODC 1 km,&nbsp;</span></p><p><span style="font-size: 11px;">Jarak ODCB ke ODP 6 Km</span></p><p><span style="font-size: 11px;">Jjarak ODP ke pelanggan 50 Km</span></p><p><br></p><p><span style="font-size: 11px;">Demikian info yang dapat disampaikan</span></p><p><span style="font-size: 11px;">Tks</span></p>', '2019-01-18', '10:21:25', ''),
(76, '2019011810241917-76', '2019011810241917', '<p><span style="font-size: 11px;">Nomor : C.Tel. 433/UM 000/R5W-5M100000/2018</span></p><p><span style="font-size: 11px;">Kepada : 1. Sdr. GM WITEL MEDAN</span></p><p><span style="font-size: 11px;">2. Sdr. GM ES MANUFACTURING AND AGRIBUSINESS SERVICES DES</span></p><p><span style="font-size: 11px;">Dari : GM WITEL SURABAYA SELATAN</span></p><p><span style="font-size: 11px;">Lampiran : 3 (tiga) berkas</span></p><p><br></p><p><span style="font-size: 11px;">Perihal : Permohonan solusi gangguan layanan VPN IP PT Samator Gas Indonesia Stabat</span></p><p><br></p><p><span style="font-size: 11px;">1. Menunjuk email pelanggan PT Samator Gas Industri terkait dengan permasalahan layanan VPN IP lokasi</span></p><p><span style="font-size: 11px;">Stabat Medan (terlampir).</span></p><p><span style="font-size: 11px;">2. Berikut detail untuk layanan existing VPN IP Samator Stabat :</span></p><p><span style="font-size: 11px;">SID 4700523-0023182812, VPN IP 512kbps.</span></p><p><span style="font-size: 11px;">Lokasi PT SGI Stabat, Ds Batu Malenggang, Pasar 2 Kec.Hinai Langkat.</span></p><p><span style="font-size: 11px;">Koordinat lokasi 3.849858, 98.427981.</span></p><p><span style="font-size: 11px;">3. Berdasarkan hasil koordinasi dengan CCAN Witel Medan, saat ini kondisi jaringan tembaga pelanggan</span></p><p><span style="font-size: 11px;">rawan gangguan karena kondisi jaringan yang sudah kritis, dimana dalam 2 bulan terakhir sudah terjadi</span></p><p><span style="font-size: 11px;">laporan gangguan sebanyak 6 (enam) kali (historis terlampir).</span></p><p><span style="font-size: 11px;">4. Sehubungan operasional pelanggan yang seringkali terganggu akibat gangguan layanan tersebut, dan SLG</span></p><p><span style="font-size: 11px;">antara Telkom dengan PT Samator Gas Industri untuk layanan VPN IP adalah 99%, dimana SLG tersebut</span></p><p><span style="font-size: 11px;">tidak dapat dijaminkan dengan kondisi jaringan existing, dimohon bantuan Saudara untuk solusi perbaikan</span></p><p><span style="font-size: 11px;">layanan yang dapat ditindaklanjuti dengan 2 (dua) opsi antara lain:</span></p><p><span style="font-size: 11px;">Modernisasi jaringan dengan melakukan penarikan FO ke lokasi pelanggan.</span></p><p><span style="font-size: 11px;">Trial Astinet lite 10Mbps via Radio sesuai dengan permintaan pelanggan dalam email terlampir.</span></p><p><span style="font-size: 11px;">5. Kami sampaikan bahwa saat ini Telkom tengah dalam proses negosiasi dengan Samator Group untuk</span></p><p><span style="font-size: 11px;">perpanjangan kontrak 2019 layanan VPN IP, Astinet Lite, dan Indihome untuk lokasi existing dan</span></p><p><span style="font-size: 11px;">penambahan lokasi baru dengan total jumlah lokasi sebanyak 97 titik di seluruh wilayah Indonesia. Untuk</span></p><p><span style="font-size: 11px;">lokasi kantor Stabat, kebutuhan layanan yang diajukan Samator Group adalah Astinet Lite 10 Mbps.</span></p><p><span style="font-size: 11px;">6. Untuk koordinasi lebih lanjut dapat menghubungi PIC pelanggan dengan Sdr. Aristianto, nomor telp 0813-</span></p><p><span style="font-size: 11px;">1133-6605, email aris@anekagas.com atau AM Telkom Sdr. Ayrton Ika Rinjani, nomor telepon 0811-342-</span></p><p><span style="font-size: 11px;">122, email ayrton@telkom.co.id.</span></p><p><span style="font-size: 11px;">7. Demikian disampaikan, atas bantuan dan kerjasamanya kami mengucapkan terimakasih.</span></p><p><br></p><p><span style="font-size: 11px;">Salam Solid Speed Smart..!</span></p><p><span style="font-size: 11px;">Surabaya, 31 Desember 2018</span></p><p><span style="font-size: 11px;">Djoko Srie Handono</span></p><p><span style="font-size: 11px;">NIK: 710372</span></p>', '2019-01-18', '10:24:58', ''),
(77, '2019011810241917-77', '2019011810241917', '<p><span style="font-size: 11px;">Update Info :&nbsp;</span></p><p><br></p><p><span style="font-size: 11px;">CUSTOMER&nbsp; &nbsp; &nbsp;: PT SAMATOR GAS INDUSTRI&nbsp;</span></p><p><span style="font-size: 11px;">ALAMAT&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Ds Batu Malenggang, Pasar 2 Kec.Hinai Langkat, Sumut Barat (MEDAN)</span></p><p><span style="font-size: 11px;">SID&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; 4700523-0023182812</span></p><p><span style="font-size: 11px;">LAYANAN&nbsp; &nbsp; &nbsp; &nbsp; : MM_VPNIP&nbsp;</span></p><p><span style="font-size: 11px;">NO TIKET&nbsp; &nbsp; &nbsp; &nbsp; : IN38418911, IN38451938, IN38912652, IN44569489, IN44881195, IN45256965</span></p><p><br></p><p><span style="font-size: 11px;">Koordinasi dg rekan TA Medan Pak Dian 085100380723,&nbsp;</span></p><p><span style="font-size: 11px;">- Dilokasi memang terkendala jalur yang sudah kritis, serta lokasi jauh dari STO, beliau menyarankan untuk dilakukan JT FO</span></p><p><span style="font-size: 11px;">- Saat ini beliau belum bisa memastikan jarak dari STO sampai pelanggan, karena perlu dilakukan survey dahulu untuk memastikan detail kebutuhan untuk proses JT dilokasi</span></p><p><span style="font-size: 11px;">- Untuk sementara beliau meminta dibuatkan order JT terlebih dahulu agar bisa segera dilakukan survey kelokasi</span></p><p><span style="font-size: 11px;">- Jika setelah survey hasilnyaa memungkinkan untuk dilakukan migrasi ke FO maka akan segera dieksekusi tetapi jika hasil survey tidak memungkinkan untuk migrasi ke FO maka akan diberikan opsi lain</span></p><p><br></p><p><span style="font-size: 11px;">Demikian infonya</span></p><p><span style="font-size: 11px;">Terima kasih</span></p>', '2019-01-18', '10:25:26', ''),
(78, '2019011810241917-78', '2019011810241917', '<p><span style="font-size: 11px;">Info Pak Zuharmen solusi ini kan butuh JT.&nbsp;</span></p><p><span style="font-size: 11px;">Sebagai info, tahun 2018 kmrn, anggaran JT TR1 defisit shg ED dan OSM BGES TR1 memberlakukan kebijakan utk mengevaluasi terlebih dahulu permintaan JT. Harus ada approval OSM BGES TR1, pak Sahat utk kelanjutan JT-nya. Selain itu, anggaran jg harus clear dulu oleh OSM ED TR1.</span></p><p><br></p><p><span style="font-size: 11px;">Order ditahun 2018 sudah beberapakali cancel karena terkait AKI / Anggaran penarikan yang tidak sesuai karena jarak ke pelanggan cukup jauh.&nbsp;</span></p><p><span style="font-size: 11px;">Terima kasih</span></p>', '2019-01-18', '10:26:36', ''),
(79, '2019011810333318-79', '2019011810333318', '<p><span style="font-size: 11px;">Nodin sudah dibuat, menunggu konfirmasi ke EOS ANTAM</span></p><p><br></p><p><span style="font-size: 11px;">Terakhir antam gangguan tanggal 3 pak leman, itu imbas gangguan masal karena link backup menggunakan satelite,</span></p><p><span style="font-size: 11px;">sampai saat ini belum ada info gangguan kembali info EOS&nbsp; dan jalur FO yang di gunakan via Menado</span></p>', '2019-01-18', '10:35:26', '');
