(29, '2019011714484306-29', '2019011714484306', '<p>Update Progres Pergantian SW Bdcom ke SW FH NTT u/ Swadarma Prima Utama Cikande</p><p><br></p><p>- Koordinasi dg pak kaptin mgr treg2, sw sudah bisa diambil dijatinegara dengan membawa nodin.</p><p>- Koordinasi dg pak asep mgr ccan banten, sedang dicarikan tim untuk melakukan pengambilan sw ke jatinegara dan akan diupdate kembali setelah ada info</p>', '2019-01-17', '14:52:02', ''),
(30, '2019011714484306-30', '2019011714484306', '<p>Update Pergantian SW Bdcom ke SW Fiber Home NTT u/ Swadarma Prima Utama Cikande</p><p><br></p><p>- Saat ini sw yg ready 24 port dan sedang di config oleh pak teguh&nbsp;</p><p>- Info dari ccan minta dibuatkan nodin JT untuk customer ini dikarenakan sebelumnyaa pernah terjadi gamas dan jalurr langsung dibypass ke sw, saat ini akan dialihkan menggunakan DC KU dengan tarikan 12 core</p>', '2019-01-17', '14:52:57', ''),
(31, '2019011714484306-31', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Pergantian SW Bdcom ke SW Fiber Home NTT u/ Swadarma Prima Utama Cikande\r\n\r\n- EOS Andira dg ccan pak juheli sudah koordinasi untuk pemasangan sw baru dilokasi, tetapi customer meminta untuk di schedule karena customer untuk saat ini belum siap ada nyaa downtime\r\n- Dan hasil koordinasi ulang dg customer maka sepakat untuk pemasangan sw akan dilakukan pada hasi Senin, 5 November 2018\r\n\r\n- Update JT saat ini masih proses disisi ccan\r\n- Estimasi belum diinfokan</pre>', '2019-01-17', '14:55:21', ''),
(27, '2019011714484306-27', '2019011714484306', '<p>Koordinasi dg EOS NTT u/&nbsp; SWADHARMA PRIMAUTAMA SID 470000651782</p><p><br></p><p>- Dilokasi link sering down disebabkan oleh SW Bdcom yang sering hang, setiap kali link down sw harus di restart dahulu agar link kembali normal</p><p>- EOS meminta untuk dilakukan pergantin sw kemungkinan sw sudah lama sehingga perlu diganti (Data Akses Eksisting : ME-D2-CKD_1/2/6_TO_SW-SWADARMA(PT.YASUNAGA)_11.1.25.162)</p><p><br></p><p>Sesui info diatas sw minta diganti bu ke L2SW Fiber Home S4800</p>', '2019-01-17', '14:50:33', ''),
(28, '2019011714484306-28', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update progres pergantian SW BDCOM ke SW Fiber Home NTT u/Swadharma Primautama Cikande Serang\r\n\r\n- Koordinasi dg Asman CCAN Banten Pak Asep +62 851-0250-3116, infonyaa saat ini sedang di jogja dan bisa koordinasi dg pak rudy\r\n- Saat ini pak rudy masih belum bisa dihubungi kemungkinan sedang progres gangguan, dan sedang dibantu koordinasi oleh eos area banten ke tim ccan untuk pergantian sw kelokasi.\r\n\r\nDemikian info progres saat ini\r\nTerima kasih</pre>', '2019-01-17', '14:51:06', ''),
(25, '2019011714311705-25', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola\r\n\r\n- Koordinasi dg eos bayu saat ini masih dilakukan test DHCP satu persatu dari setiap site, dan sejauh ini hasil normal tidak ada kendala\r\n- Akan diupdate kembali setelah setelah test all site \r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '14:41:48', ''),
(26, '2019011714484306-26', '2019011714484306', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Bu Dinni mhn bantuan enhance NTT Ind utk Yasunaga lok Cikande, sw sering hang, up setelah direstart dan saat ini msh pake sw bdcom :\r\n\r\nYasunaga Indonesia area Serang Cikande\r\n\r\nKAWASAN INDUSTRI MODERN CIKANDE KAV.24#KAV.24#CKD#SERANG#42186\r\n\r\n*IN39247347*\r\n[470000651782/CAESAR /+62 812-8966-2664] [REQUEST LOG] SWADHARMA PRIMAUTAMA SID 470000651782 [C_REQ][TOP20][DES]\r\n\r\n*IN38995032*\r\n[470000651782/CAESAR/+62 812-8966-2664] [REQUEST LOG] SWADHARMA PRIMAUTAMA SID 470000651782 U/YASUNAGA [C_REQ][TOP20][DES]\r\n\r\n*IN39247347*\r\nopen ticket : 15-10-2018 16:14:25\r\nclose ticket : 18-10-2018 09:12:21\r\n\r\n*IN38995032*\r\nopen ticket : 10-10-2018 17:22:45\r\nclose ticket : 12-10-2018 18:53:42\r\n\r\nupdate info :\r\n\r\n- terima laporan request LOG layanan down\r\n- pengecekan log sisi metro \r\n\r\nA:ME-D2-CKD# show log log-id 99 | match 1/2/6      \r\n"Processing of an access port state change event is finished and the status of all affected SAPs on port 1/2/6 has been updated."\r\n640997 2018/10/15 07:39:57.14 WIB WARNING: SNMP #2005 Base 1/2/6\r\n"Interface 1/2/6 is operational"\r\n"Processing of an access port state change event is finished and the status of all affected SAPs on port 1/2/6 has been updated."\r\n640992 2018/10/15 07:39:57.10 WIB WARNING: SNMP #2004 Base 1/2/6\r\n"Interface 1/2/6 is not operational"\r\n\r\nA:ME-D2-CKD# show log log-id 99 | match 1/2/6      \r\n"Processing of an access port state change event is finished and the status of all affected SAPs on port 1/2/6 has been updated."\r\n640997 2018/10/15 07:39:57.14 WIB WARNING: SNMP #2005 Base 1/2/6\r\n"Interface 1/2/6 is operational"\r\n"Processing of an access port state change event is finished and the status of all affected SAPs on port 1/2/6 has been updated."\r\n640992 2018/10/15 07:39:57.10 WIB WARNING: SNMP #2004 Base 1/2/6\r\n"Interface 1/2/6 is not operational"\r\n\r\n- terdapat perubahan di last state change di sisi metro \r\n- kordinasi dengan tim area dilakukan restart sisi SW SW-SWADARMA(PT.YASUNAGA)_11.1.25.162\r\n- setelah restart SW layanan up kembali\r\n\r\ndemikian info nya terima kasih Pak Daud</pre>', '2019-01-17', '14:49:49', ''),
(23, '2019011714311705-23', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola \r\nKamis, 22 November 2018 puku 17.00 wib\r\n\r\n- Koordinasi dg eos bayu migrasi akan dilakukan malam ini pukul 21.00 sesuai ijin dri customer\r\n\r\nDemikian infonya\r\nTks</pre>', '2019-01-17', '14:41:11', ''),
(24, '2019011714311705-24', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola\r\n\r\nKamsi, 22 November 2018  Pukul 22.30 wib\r\n\r\n- Pada pukul 21:00 WIB telah dilakukan pemindahan uplink metro end 1 ke ME-D2-CBT 3/2/10\r\n- Untuk hasil pengetesan bandwidth sudah sesuai yaitu 150 Mbps\r\n- Untuk pengetesan routing RIP (OK) Dan hasil trace sudah melalui link Backhoul VPN IP dengan beberapa sample HO regional (operation)\r\n- Untuk pengetesan service DHCP Akan dilakukan pagi ini\r\n\r\nDemikian infonya\r\nTks</pre>', '2019-01-17', '14:41:31', ''),
(22, '2019011714311705-22', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola \r\n\r\n- Konfirmasi EOS Bayu terkait migrasi masih belum mendapatkan jadwal dari customer\r\n\r\nDemikian infonya\r\nTks</pre>', '2019-01-17', '14:40:51', ''),
(21, '2019011714311705-21', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola 12 November 2018\r\n\r\n- Pukul 11:00 WIB telah dilakukan test ulang service DHCP Pool di link Operation Coca cola Pondok ungu yang berada Satu PE dengan BH Coca Cola (PE4-D2-JT2-VPN)\r\n- Hasil test membuktikan bahwa tidak ada blocking disisi PE telkom Dan sudah di infokan ke pihak IT Coca Cola\r\n- untuk jadwal pemindahan layanan, masih menunggu izin downtime dari pihak IT Coca Cola</pre>', '2019-01-17', '14:40:30', ''),
(20, '2019011714311705-20', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Info Progres Migrasi Backhoul Coca Cola :\r\n\r\nUpdate info sebelumnya :\r\n5 November 2018\r\nInfo progress :\r\n- Kordinasi dengan Pak Wawan rekan arnet bekasi untuk mengganti SFP di metro (ME-D2-CBT 3/2/10) dengan sfp kapasitas 1 Gb dengan length 80 km\r\n- Pergantian ini agar nilai redaman low alarm di metro (ME-D2-CBT 3/2/10) turun menjadi -24 db yang sebelum nya - 20 db\r\n- Setelah dilakukan pergantian SFP di metro dan dicoba test loop kembali untuk redaman low alarm di metro (ME-D2-CBT 3/2/10) menjadi -24 db \r\n- tetapi redaman RX: -29 db dan status port di metro (ME-D2-CBT 3/2/10) down\r\n- Hasil kordinasi dengan pak wawan memang perlu dilakukan pengecekan core dari ODC ke arah STO Cibitung\r\n- Sudah coba kordinasi untuk pindah core dari ODC ke STO Cibitung tetapi tidak terdapat core yang idle\r\n\r\nProgres 7 November 2018 :\r\n- Telah dilakukan test loop di ODC dapat redaman -4,57 dengan redaman low alarm -24,10, koordinasi dengan Bp Budiman kualitas redaman bagus \r\n- lanjut test loop di OTB Coca Cola redaman masih -38, kemudian ganti conector disisi ODC untuk port 3 dan 4 hasil loop redaman menjadi -9.90\r\n- Kemudian dari OTB dikoneksikan ke SW Fiberhome Coca Cola redaman -13.06 dengan Low Alarm -24.10 kondisi SW saat ini Up Up, sudah bisa di ping dan Telnet dari PE MGT\r\n- Sudah email ke IT Coca Cola dengan Bp Candra terkait Plan Migrasinya, sambil menunggu izin downtime perpindahan jalurnya\r\n\r\nTerima Kasih.</pre>', '2019-01-17', '14:37:45', ''),
(19, '2019011714311705-19', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">*Update Migrasi L2SW Coca Cola Cibitung*\r\n\r\nHasil confrance EOS - Mgr CCAN Bekasi Pak Priambono - SPV CCAN Bekasi Ervan\r\n- Hasil pengecekan core sebelumnyaa redaman masih tinggi mencapai -20 s/d 21\r\n- Saat ini ccan bekasi ervan akan melakukan loop disisi ODC to metro untuk memastikan kembali redamannya\r\n- Jika hasil pengecekan disisi odc redman tinggi maka akan dilakukan pengecekan pada core lain yg idle, dan info dari eos ada core yg idle dulu pernah digunakan untuk core backhoul via sto cikarang atau yg lain\r\n\r\n\r\n*Update Hasil Test Core* \r\n- Test pertama loop dari ODC didapat redaman -38, hasilnyaa terlalu besar sehingga dilakkukan pergantian konektor disisi ODC sehingga hasil loop nyaa didapat -7\r\n- Test kedua dilakukan disisi OTB Coca Cola didapat -9\r\n- Dan test ketiga dilakukan disisi SW Coca Cola didapat -13\r\n- Setelah dipasang ke sw redaman sudah bagus, tetapi Oper State di Metro masih terbaca down\r\n- Koordinasi dengan Arnet Pak Budiman hasil pengecekan diatas sudah bagus, terkait sw yg masih terbaca down beliau sarankan untuk cek configurasi kembali disisi sw nya\r\n- Saat ini eos sedang melakuakan pengecekan ulang configurasi disisi sw nya, karena info eos sw pengganti bukan sw baru sehingga terindikasi sw hang\r\n- Saat ini masih dalam investigasi oleh eos</pre>', '2019-01-17', '14:37:15', ''),
(18, '2019011714311705-18', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">*Update Progres Migrasi ke SW VPNIP BH Customer CocaCola Cibitung*\r\n\r\n1 November 2018\r\nInfo progress :\r\n- Switch fiberhome sudah terpasang dan aktif\r\n- tetapi oper state di metro down (ME-D2-CBT 3/2/10)\r\n- Kordinasi dengan Pak Wawan (Rekan Arnet Bekasi) : infokan untuk coba test loop terlebih dahulu disisi OTB Coca cola \r\n- Hasil test loop : (ME-D2-CBT 3/2/10) oper state di port metro up dan redaman - 20 db (Redaman terlalu kecil karena alert alarm nya di -21 db)\r\n- Hasil ukur loop di OTB coca cola terdapat tanda seru di low alarm metro yang menandakan redaman tidak bagus untuk RX\r\n\r\n2 November 2018\r\nInfo progress :\r\n- Kordinasi dengan rekan ero CCAN bekasi untuk melalukan test loop di port atau di OTB metro STO Cibitung agar mengetahui kualitas port metro (ME-D2-CBT 3/2/10)\r\n- Hasil loop di OTB STO Cibitung kearah metro (ME-D2-CBT 3/2/10) TX:-6 db RX:-8 db\r\n- Hasil loop menunjukan core dari OTC STO Cibitung kearah Metro (ME-D2-CBT 3/2/10) OK\r\n- Lalu dicoba ukur dengan OPM untuk setiap core di OTB Coca Cola, Hasil ukur untuk TX:-15 db dan RX:-14 db\r\n- Dengan kondisi tersebut, dilakukan test loop kembali dengan redaman RX: -21 db di metro cibitung (ME-D2-CBT 3/2/10)\r\n- Hasil redaman RX:-21 db dengan low alarm -20 db\r\n- Status oper state ke switch fiberhome masih down\r\n\r\n5 November 2018\r\nInfo progress :\r\n- Kordinasi dengan Pak Wawan rekan arnet bekasi untuk mengganti SFP di metro (ME-D2-CBT 3/2/10) dengan sfp kapasitas 1 Gb dengan length 80 km\r\n- Pergantian ini agar nilai redaman low alarm di metro (ME-D2-CBT 3/2/10) turun menjadi -24 db yang sebelum nya - 20 db\r\n- Setelah dilakukan pergantian SFP di metro dan dicoba test loop kembali untuk redaman low alarm di metro (ME-D2-CBT 3/2/10) menjadi -24 db \r\n- tetapi redaman RX: -29 db dan status port di metro (ME-D2-CBT 3/2/10) down\r\n- Hasil kordinasi dengan pak wawan memang perlu dilakukan pengecekan core dari ODC ke arah STO Cibitung\r\n- Sudah coba kordinasi untuk pindah core dari ODC ke STO Cibitung tetapi tidak terdapat core yang idle\r\n\r\nUntuk progres selanjutnya :\r\n- Akan dicoba memastikan kembali untuk kualitas core dari ODC ke STO Cibitung \r\n- Serta dilakukan pengecekan ke perangkat switch nya\r\n- Untuk pengecekan switch nya akan dicoba langsung di STO Cibitung\r\n- Hal ini untuk melihat kondisi port metro (ME-D2-CBT 3/2/10) kearah switch up atau down (kondisi direct connected di STO Cibitung)\r\nTerima Kasih.</pre>', '2019-01-17', '14:36:22', ''),
(17, '2019011714311705-17', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Info update migrasi VPNIP CocaCola Cibitung : \r\n- Metro uplink ME-D2-CBT 3/2/10\r\n- redaman TX - 15\r\n- akan diinfokan kembali untuk pemasangan switch fiberhome (karena kordinasi dahulu dengan Pak candra untuk alokasi rack dan power nya)</pre>', '2019-01-17', '14:35:40', ''),
(16, '2019011714311705-16', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Progres Migrasi ke SW VPNIP BH Customer CocaCola Cibitung\r\n\r\n- Saat ini sedang dilakukan pengecekan sto untuk pencarian port metro didampingi oleh tim arnet\r\n- Ada perubahan alokasi port metro sehingga dilakukan pengecekan ulang CCAN dan tim ARNET</pre>', '2019-01-17', '14:35:13', ''),
(15, '2019011714311705-15', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Progres Migrasi VPNIP BH CocaCola Cibitung\r\n\r\n- Saat ini masih dilakukan pelurusan core oleh tim TA Cibitung\r\n- Estimasi belum diinfokan\r\n\r\nhttps://postimg.cc/TLjcff9B</pre>', '2019-01-17', '14:34:44', ''),
(14, '2019011714311705-14', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update migrasi BH VPNIP COCA COLA\r\n\r\n- L2SW Sudah diambil ke gudang oleh EOS Dimas pukul 10.00 wib\r\n- Uplink metro info dari arnet ada 2 opsi via cikarang (Port 5/2/19 ME2-D2-CIK), dan via cibitung (Port 3/2/10 ME-D2-CBT)\r\nNote : untuk cibitung saat ini port terbaca masih down belum ada redaman jika akan digunakan harap diinfokan dahulu ke tim arnet nanti akan dibantu diUP kan \r\n- Info dari tim RA untuk alokasi ip pada sw fiberhome :\r\n  PE-D2-JT2-MGT GI0/2\r\n  IP OAM SW 172.24.24.83 \r\n  GW 172.24.24.65/26	\r\n  VLAN 507\r\n\r\nSaat ini untuk proses config l2sw sedang proses oleh eos coca cola</pre>', '2019-01-17', '14:34:10', ''),
(12, '2019011714311705-12', '2019011714311705', '<div style="overflow: scroll hidden; width: 1024px; border: none;"><pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Akan dilakukan pindah jalur dari GPON  ke L2SW oleh tim CCAN  dan saat ini sedang menunggu proses pembuatan MO yang akan bisa dilakukan minggu ke 3 bulan oktober 18 dikarenakan ada administrasi yg harus disesuaikan</pre></div>', '2019-01-17', '14:32:07', ''),
(13, '2019011714311705-13', '2019011714311705', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update case migrasi coca-cola :\r\n\r\n- Nodin telah dibuatkan dan diteruskan ke Pak Kaptin (Penyedia perangkat), CCAN Bekasi, dan EOS Coca Cola Mas Dimas.\r\n- Hasil konfirmasi ke EOS terkait, infokan untuk tarikan dropcore yang akan dicatu ke switch sudah tersedia dan sudah dilakukan pengecekan redaman oleh CCAN. hasilnya -10db. (Masih dibawah standart, rencana akan ditambahkan splitter oleh team CCAN untuk meningkatkan redamannya)\r\n- Perangkat L2switch akan diambil esok hari di Jatinegara dengan membawa nodin oleh EOS Coca Cola.\r\n\r\nDemikian updatenya, terimakasih &#128591;</pre>', '2019-01-17', '14:33:40', ''),
(11, '2019011714241304-11', '2019011714241304', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Dear Ibu Anisah\r\n\r\nMohon update mengenai hal ini, karena sampai saat ini kami masih pantau belum ada progress dan instruksi bahwa koneksi bisa di gunakan kembali\r\n\r\nTerima kasih\r\n\r\nFrom: Anisah Sofwati [mailto:anisah@telkom.co.id] \r\nSent: Jumat, 05 Oktober 2018 16.07\r\nTo: Ariestian Firdaus; Aleksa Sihombing; Hadi Iswanto\r\nCc: C4; Herman Triadi; nizar.zain@patrakom.co.id; adityarizki@patrakom.co.id; Satria Adiatma\r\nSubject: Re: Laporan Gangguan Koneksi PGE PGM KPP PT Evans Indonesia\r\n\r\nDear pak Aries,\r\n\r\nDari laporan Bapak beberapa hari lalu mengenai bandwidth yang tidak sesuai dan permintaan penggantian device (kami menyebutnya modem ONT) untuk penggabungan jalur, dapat saya sampaikan sbb:\r\n\r\n1. Kami tim Telkom dan Patrakom sepakat untuk melakukan test per segmen, untuk mengetahui di mana tepatnya bandwidth drop. Apakah root cause nya betul karena modem ONT yg berbeda antara 3 jalur yang ke Pangkatan dan jalur ke Bilah dan Senna? Karena secara spek perangkat, modem ONT yang digunakan untuk melayani 5 site itu adalah sama. Tiap modem ONT hanya ada 2 port untuk melayani 2 layanan. Perbedaan antara layanan ke PGE, PGM, KPP dengan ke Bilah dan Senna adalah di topologi network menuju ke lima site tersebut.\r\n\r\n2. Sejak kemarin tim Patrakom sudah bertemu dan berkoordinasi dengan tim Telkom di Rantau Prapat. Hasil pengukuran di Sentral Telkom Aek Nabara pagi ini, keluaran bandwidth di device/ONT yang melayani PGE, PGM, dan KPP sudah dikirim di email sebelum ini. Terlihat dari capture bahwa bandwidth upload dan download adalah sesuai paket langganan, 1 : 1 sebesar 2 Mbps. Artinya tidak ada kendala bandwidth dari device/modem ONT. Sehingga bandwith yg dikirimkan ke PGE melalui perangkat radio adalah sesuai sebesar 6 Mbps.\r\n\r\n3. Saat ini tim Patrakom masih meneruskan investigasi untuk mengecek bandwidth di PGE, apakah masih sesuai yg terkirim dari Sentral Telkom Aek Nabara yaitu 6 Mbps, dan apakah yg terbagi merata ke 3 site yaitu masing-masing 2 Mbps.\r\n\r\nDemikian update sementara yg dapat kami sampaikan. Jika ada perkembangan dari hasil investagasi tim kami, akan kami update kembali.\r\n\r\nTerima kasih atas perhatian dan kerja samanya.\r\n\r\nRegards,\r\n\r\n\r\nAnisah Sofwati\r\nSenior Account Manager\r\nTelkom Divisi Enterprise Services - Segmen Manufacture &amp; Agribusiness\r\nMenara Multi Media\r\nJl. Kebon Sirih No. 10 - 12 Jakarta Pusat\r\nTelp / WA: 0811-2268008</pre>', '2019-01-17', '14:26:18', ''),
(9, '2019011713565703-9', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update VPNIP PT INDOMOBIL GROUP KOMP. RAPP PANGKALAN KERINCI \r\n\r\n- Penarikan sudah selesai \r\n- Link sudah berjalan lancar seperti semula\r\n\r\nDemikian infonyaa\r\nTks</pre>', '2019-01-17', '13:59:27', ''),
