(8, '2019011713565703-8', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update VPNIP PT INDOMOBIL GROUP KOMP. RAPP PANGKALAN KERINCI \r\nKamis 08 Nov 2018 \r\n\r\n- Info Pak Arman Mitra Optima saat ini masih proses penggalian, dan tingga 300 meter lagi sampai di Indomobil Indotruck\r\n- Estimasi jumat 9 Nov 2018 sudah mulai penarikan\r\n- Saat ini masih menunggu info dari petugas hasil progres penarikan FO dilokasi\r\n\r\nAkan diupdate kembali setlah ada info dari petugas\r\nTerima kasih</pre>', '2019-01-17', '13:59:14', ''),
(7, '2019011713565703-7', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Progres Selasa, 06 November 2018 \r\n----------------------------------------------------------\r\nIN38193673 PT INDOMOBIL GROUP RIAU DARATAN (PEKANBARU)\r\n- Info EOS untuk saat ini tim sedang penggalian\r\n- Estimasi selesai penarikan hari jumat 9 oktober 2018 \r\n- Tiket sementara dipending</pre>', '2019-01-17', '13:58:59', ''),
(6, '2019011713565703-6', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update Progres Kamis, 25 Oktober 2018\r\n------------------------------------------------\r\nDear OSM SVA &amp; Para MGR IM Ysh,\r\n\r\nMohon dibantu percepatan perbaikan IN38193673\r\n[Ganda/082173257530][GANGGUAN][DES][IBS][TOP200]VPNIP PT INDOMOBIL GROUP KOMP. RAPP PANGKALAN KERINCI\r\nLayanan   	: VPNIP\r\nNo ticket 	: IN38193673\r\nTTR		: 19 Jam\r\nWitel		: TREG 1 - RIDAR\r\nKeluhan 	: Layanan Down\r\nopen tiket 	: 27-09-2018 15:59:09\r\n\r\nUpdate Info Terbaru 24-10-2018: \r\n- Call Pak Arman 081378631802 Mitra Optima : Saat ini masih menunggu permit keluar dari pihak RAPP\r\nbaru setelah permit selesai bisa mendaftar untuk safety induction dan dilanjut pembuatan ID dan penarikan\r\n\r\nUpdate Info Terbaru 25-10-2018: \r\n- Call Pak Arman 081378631802 Mitra Optima : Infonya permit sudah keluar dari pihak RAPP\r\nnamun ternyata hanya permit untuk penarikan node B telkomsel (padahal eos sudah infokan bahwa pihak\r\nbahwa pihak RAPP meminta permit berbeda dengan telkomsel karna beda pengerjaan)\r\ndan besok tim mitra Optima akan urus permit lagi untuk indomobil dan safety induction beserta IDnya\r\nestimasi besok sudah safety induction\r\n\r\n\r\nMohon dukungan dan Percepatan perbaikan\r\nTerimakasih\r\n\r\nSalam 3S\r\nAl Khadri (Indomobil)</pre>', '2019-01-17', '13:58:43', ''),
(2, '2019011711295402-2', '2019011711295402', '<p>Sudah dilakukan pergantian L2SW oleh tim CCAN&nbsp; dan link sudah kembali normal</p>', '2019-01-17', '11:31:47', ''),
(3, '2019011713565703-3', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">"Sedang menunggu pembuatan MO dari am untuk migrasi ke FO\r\nNota Dinas\r\n\r\nNomor  :  C.Tel. 21/YN 000/R1W-1H360000/2018\r\nKepada  :  Sdr. MGR ACCESS OPTIMA AND MAINTENANCE PEKANBARU\r\nDari  :  MGR CCAN PEKANBARU\r\nLampiran  :  -\r\nPerihal  :  Penarikan FTTH PT Indomobil Truck Pangkalan Kerinci\r\n\r\nSehubungan dengan ganggguan Corporate Customer VPNIP PT INDOMOBIL TRUCK alamat JL. SP 7 PANGKALAN KERINCI, Nomor tiket ggn IN38196195. Tikor pelanggan 0.433502,101.888678\r\nODP terdekat dengan Customer adalah ODP-PKR_FC37/38 koordinat 0.429502,101.881098\r\nUntuk komunikasi lebih lanjut, mhn dpt berkoordinasi dengan Pic PT INDOMOBIL TRUCK dengan bapak Irwan/08127600403 dan Asman Assurance CCAN Yuskarnaini/081378378008.\r\nDemikian kami sampaikan, terima kasih atas dukungan dan support teknisnya\r\n\r\nPekanbaru, 28 September 2018\r\n\r\nAryono\r\nNIK: 740294\r\nTembusan:\r\n1. Sdr. MGR GOVERNMENT AND ENTERPRISE SERVICE PEKANBARU\r\n2. Sdr. MGR BUSINESS SERVICE PEKANBARU\r\n3. Sdr. ASMAN CONSTRUCTION SUPERVISION PEKANBARU\r\n4. Sdr. ASMAN DEPLOYMENT AND CAPEX MGT PEKANBARU\r\n5. Sdr. ASMAN MAINTENANCE AND QE PEKANBARU\r\n6. Sdr. ASMAN PARTNERSHIP INFRASTRUCTURE PEKANBARU\r\n7. Sdr. ASMAN CCAN ASSURANCE PEKANBARU"</pre>', '2019-01-17', '13:57:42', ''),
(4, '2019011713565703-4', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;"><span style="font-weight: 700;">Catatan untuk update sebelumnyaa untuk penarikan FO perlu dibuatkan permit dari komp RAPP dan bisa menghubungi Pak Dedi Kurnia 08127543697 selaku Kepala IT RAPP</span>\r\n\r\n\r\n<span style="font-weight: 700;">Update Selasa 16-10-2018</span>\r\nUpdate Info Indomobil RAPP Kerinci : \r\n- Call MGR Optima Bp Derys 081373019965 -&gt; Saat ini sedang rapat\r\n- Call Pihak Kawasan RAPP Dedi Kurnia 08127543697\r\nBelum ada tim Mitra atau Optima yang kontak Pihak RAPP sesuai kesepakatan kemaren sore dimana harusnya pagi ini tim\r\nMitra / Optima menghubungi pihak Kawasan RAPP utk bertemu dan menjelaskan case indotruck (pengerjaan apa yang akan dilakukan\r\ndan apabila melakukan penarikan jalurnya harus lewat mana saja)\r\nkarena tim mitra hanya menjelaskan permasalahan penarikan node-b telkomsel dan tidak menginfokan case indomobil.\r\nPihak RAPP minta apabila mau ke kawasan harus menghubungi pihak RAPP dahulu karena untuk izin masuk kawasan harus sebelum datang\r\nke RAPP.</pre>', '2019-01-17', '13:58:03', ''),
(5, '2019011713565703-5', '2019011713565703', '<pre style="font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 10px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;">Update progres Rabu, 17 Oktober 2018\r\n------------------------------------------------------\r\nMohon dibantu percepatan perbaikan IN38193673\r\n[Ganda/082173257530][GANGGUAN][DES][IBS][TOP200]VPNIP PT INDOMOBIL GROUP KOMP. RAPP PANGKALAN KERINCI\r\nLayanan   	: VPNIP\r\nNo ticket 	: IN38193673\r\nTTR		: 19 Jam\r\nWitel		: TREG 1 - RIDAR\r\nKeluhan 	: Layanan Down\r\nopen tiket 	: 27-09-2018 15:59:09\r\n\r\nUpdate Info Terbaru 23-10-2018: \r\n- Call Pak Arman 081378631802 Mitra Optima : Untuk berkas sudah dilengkapi semua, namun infonya masih menunggu permit dari RAPP\r\ndahulu baru bisa mendaftar untuk pelatihan safety induction dari pihak RAPP nya. estimasi masih penarikan masih belum diketahui namun\r\npenarikan dilakukan setelah permit, safety induction dan id telah dikeluarkan oleh pihak RAPP\r\n\r\nUpdate Info Terbaru 24-10-2018: \r\n- Call Pak Arman 081378631802 Mitra Optima : Saat ini masih menunggu permit keluar dari pihak RAPP\r\nbaru setelah permit selesai bisa mendaftar untuk safety induction dan dilanjut pembuatan ID dan penarikan\r\n\r\n\r\nMohon dukungan dan Percepatan perbaikan\r\nTerimakasih\r\n\r\nSalam 3S\r\nAl Khadri (Indomobil)</pre>', '2019-01-17', '13:58:26', ''),
