(91, '2019020109331822-91', '2019020109331822', '<p>Di Lokasi SUdah MIGRASI FO.</p><p>[ME-D5-TOP] int Eth-Trunk4.3521<br>#<br>interface Eth-Trunk4.3521<br>&nbsp;vlan-type dot1q 3521<br>&nbsp;description MM_TRANS_ACCESS BANK PERMATA (BANK BALI) SID 4700042-0021480224<br>&nbsp;mpls l2vc 172.31.242.1 1966633521<br>&nbsp;statistic enable<br>#<br>return<br>[ME-D5-TOP] int Eth-Trunk4&nbsp;&nbsp;&nbsp;&nbsp; <br>#<br>interface Eth-Trunk4<br>&nbsp;description PLINK Akses_TO_GPON02-D5-TOP-5_INTG20160624091637_IP_172.25.207.162<br>&nbsp;mode lacp-static<br>&nbsp;load-balance packet-all<br>#<br>return<br>[ME-D5-TOP]</p><p><br></p><p>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#sho run int Gi0/0/1/0.3521<br>Mon Feb&nbsp; 4 15:12:31.616 GMT<br>interface GigabitEthernet0/0/1/0.3521<br>&nbsp;description VPN IP TRANSACC BANK PERMATA (BANK BALI) SE TOHPATI, JL WR SUPRATMAN, DENPASAR BALI SID 4700042-0021480224<br>&nbsp;bandwidth 32<br>&nbsp;service-policy input rate_limit_64k<br>&nbsp;service-policy output rate_limit_64k<br>&nbsp;vrf Bank_Permata<br>&nbsp;ipv4 address 10.62.5.189 255.255.255.252<br>&nbsp;encapsulation dot1q 3521<br>!<br><br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#sho arp vrf Bank_Permata | i 0/0/1/0.3521<br>Mon Feb&nbsp; 4 15:12:41.981 GMT<br>10.62.5.189&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10f3.1102.6e98&nbsp; Interface&nbsp; ARPA&nbsp; GigabitEthernet0/0/1/0.3521<br>10.62.5.190&nbsp;&nbsp;&nbsp;&nbsp; 00:09:26&nbsp;&nbsp; 0001.2e5f.51d0&nbsp; Dynamic&nbsp;&nbsp;&nbsp; ARPA&nbsp; GigabitEthernet0/0/1/0.3521<br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#ping vrf Bank_Permata 10.62.5.190<br>Mon Feb&nbsp; 4 15:12:50.806 GMT<br>Type escape sequence to abort.<br>Sending 5, 100-byte ICMP Echos to 10.62.5.190, timeout is 2 seconds:<br>!!!!!<br>Success rate is 100 percent (5/5), round-trip min/avg/max = 3/3/3 ms<br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#<br></p><p><br></p>', '2019-02-04', '14:32:32', ''),
(92, '2019020109292421-92', '2019020109292421', '<p>Layanan Sudah MIGRASI FO di Lokasi.</p><p><br></p><p>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#sho run int Gi0/0/1/12.3769<br>Mon Feb&nbsp; 4 21:19:17.595 GMT<br>interface GigabitEthernet0/0/1/12.3769<br>&nbsp;description TRANS ACCESS BANK PERMATA TOKO RAMA KRISNA JL. RAYA TUBAN DENPASAR SID 4700042-09285<br>&nbsp;bandwidth 32<br>&nbsp;service-policy input rate_limit_64k<br>&nbsp;service-policy output rate_limit_64k<br>&nbsp;vrf Bank_Permata<br>&nbsp;ipv4 address 10.62.3.13 255.255.255.252<br>&nbsp;encapsulation dot1q 3769<br>!<br><br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#sho arp vrf Bank_Permata | i 0/0/1/12.3769<br>Mon Feb&nbsp; 4 21:19:46.276 GMT<br>10.62.3.13&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10f3.1102.6ea4&nbsp; Interface&nbsp; ARPA&nbsp; GigabitEthernet0/0/1/12.3769<br>10.62.3.14&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 00:02:53&nbsp;&nbsp; 0001.2ebb.3941&nbsp; Dynamic&nbsp;&nbsp;&nbsp; ARPA&nbsp; GigabitEthernet0/0/1/12.3769<br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#ping vrf Bank_Permata 10.62.3.14&nbsp; c 100<br>Mon Feb&nbsp; 4 21:20:04.400 GMT<br>Type escape sequence to abort.<br>Sending 100, 100-byte ICMP Echos to 10.62.3.14, timeout is 2 seconds:<br>!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!<br>!!!!!!!!!!!!!!!!!!!!!.!!!!!!!!<br>Success rate is 99 percent (99/100), round-trip min/avg/max = 1/3/7 ms<br>RP/0/RSP0/CPU0:PE-D5-KLM-VPN#<br><br><br>&lt;ME-D5-KUT&gt;dis cur int GigabitEthernet6/0/0.3769<br>#<br>interface GigabitEthernet6/0/0.3769<br>&nbsp;vlan-type dot1q 3769<br>&nbsp;description BANK_PERMATA_SID 4700042-09285<br>&nbsp;mtu 1986<br>&nbsp;mpls l2vc 172.31.242.1 1966663769<br>&nbsp;mpls l2vc 172.31.242.9 1966653769 secondary<br>&nbsp;trust upstream default<br>&nbsp;trust 8021p<br>&nbsp;statistic enable<br>#<br>return<br>&lt;ME-D5-KUT&gt;dis cur int GigabitEthernet6/0/0&nbsp;&nbsp;&nbsp;&nbsp; <br>#<br>interface GigabitEthernet6/0/0<br>&nbsp;description AKSES_TO_G